import React, { useState, useEffect } from 'react';
import axios from 'axios';

const TotalQueries = () => {
  const [totalQueries, setTotalQueries] = useState(0);

  useEffect(() => {
    const fetchTotalQueries = async () => {
      try {
        const response = await axios.get('http://127.0.0.1:5000/total-queries');
        setTotalQueries(response.data.total_queries);
      } catch (error) {
        console.error('Error fetching total queries:', error);
      }
    };

    fetchTotalQueries();
  }, []);

  return (
    <div>
      <p>Total User Queries: {totalQueries}</p>
    </div>
  );
};

export default TotalQueries;
